import React from 'react';
import './Btn.css';

const Btn = ({ handlePrevPage, handleNextPage }) => {
	return (
		<div className='btn'>
			<button onClick={handlePrevPage}>PREV</button>
			<button onClick={handleNextPage}>NEXT</button>
		</div>
	);
};

export default Btn;
